using System;
using System.Collections.Generic;

public class Solution {
    private int GetMask(int num) {
        int mask = 0;
        for (int i = 2; i * i <= num; ++i) {
            if (num % i == 0) {
                int count = 0;
                while (num % i == 0) {
                    num /= i;
                    ++count;
                }
                if (count % 2 != 0) mask ^= 1 << i;
            }
        }
        if (num > 1) mask ^= 1 << num;
        return mask;
    }

    public long MaximumSum(IList<int> nums) {
        Dictionary<int, long> dp = new Dictionary<int, long>();
        long answer = 0;
        foreach (int num in nums) {
            Dictionary<int, long> tempDp = new Dictionary<int, long>(dp);
            int mask = GetMask(num);
            answer = Math.Max(answer, num);

            foreach (var pair in tempDp) {
                int newMask = pair.Key ^ mask;
                long newSum = pair.Value + num;
                if (!dp.ContainsKey(newMask)) dp[newMask] = 0;
                dp[newMask] = Math.Max(dp[newMask], newSum);
                answer = Math.Max(answer, dp[newMask]);
            }

            if (!dp.ContainsKey(mask)) dp[mask] = 0;
            dp[mask] = Math.Max(dp[mask], (long)num);
        }
        return answer;
    }
}
